css:
.highlight-view.hidden {
  display: none;
}
.atom-text-editor .line.highlight-line,
:host .line.highlight-line,
atom-text-editor .line.highlight-line,
atom-text-editor::shadow .line.highlight-line {
  background: rgba(100, 100, 100, 0.3) !important;
}
.atom-text-editor .line[class*="highlight-line-multi-line-solid-top"],
:host .line[class*="highlight-line-multi-line-solid-top"],
atom-text-editor .line[class*="highlight-line-multi-line-solid-top"],
atom-text-editor::shadow .line[class*="highlight-line-multi-line-solid-top"] {
  border-top-style: solid;
  border-top-width: 1px;
  border-top-color: #ffff00;
  margin-top: -1px;
}
